import React from "react";
import { useParams } from "react-router-dom";
import SimpleRoadmapAirplane from "../components/SimpleRoadmapAirplane";
import RoadmapAirplane from "../components/RoadmapAirplane";

const Roadmap = () => {
  const { roleSlug } = useParams();

  // If we have a roleSlug, show the simple roadmap, otherwise show the default
  if (roleSlug) {
    return <SimpleRoadmapAirplane />;
  }

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <RoadmapAirplane />
    </div>
  );
};

export default Roadmap;
